import React from "react";

const Userentry = () => {
  const heading = [
    {
      entryHeading: "Cycle 2",
    },
    {
      entryHeading: "16 Sep - 30 Sep",
    },
  ];

  const entries = [
    {
      userName: "Abhijeet Acharya",
    },
    {
      price: "1200",
    },
    {
      additionalInfo: "MH/2222483703",
    },
    {
      dateIssue: "Issued on 12 Dec - 2020",
    },
  ];
  return (
    <section className="user-entries">
      <h1>{heading[0].entryHeading}</h1>
      <p>{heading[1].entryHeading}</p>
      <ul>
        <li>{entries[0].userName}</li>
        <li>{entries[1].price}</li>
        <li>{entries[2].additionalInfo}</li>
      </ul>
    </section>
  );
};

export default Userentry;
